def custom_fib(signature, indexes, n):
    if n <= len(signature):
        return signature[n-1]
    else:
        queue = deque(signature, maxlen=len(signature))
        for _ in range(n - len(signature)):
            next_val = sum([queue[i-1] for i in indexes])
            queue.append(next_val)
        return queue[-1]
